import React from "react";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const ProfileRest = () => {
  return (
    <div>
      <h1 className="header-rest">A comer!</h1>
      <h3
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
          fontSize: "24px",
          margin: "20px",
          paddingTop: "20px",
        }}
      >
        Bienvenida
      </h3>
      <p
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
          fontSize: "25px",
        }}
      >
        Fonda Don José
      </p>

      <div
        style={{
          fontFamily: "GothamBook",
          fontSize: "14px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          padding: "10px 0",
        }}
      >
        <Button
          size="lg"
          style={{
            padding: "12px 100px",
            border: " 3px solid #fb923c",
            backgroundColor: "#F9FAFB",
            color: "#000000",
            borderRadius: "15px",
          }}
        >
          Mis pedidos
        </Button>{" "}
        <Link
          to="/login"
          style={{
            fontFamily: "GothamBold",
            fontSize: "14px",
            color: "#2FB423",
            textDecorationLine: "underline",
          }}
        >
          Inicia Sesión
        </Link>
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          margin: "20px",
          fontFamily: "GothamBook",
          fontSize: "14px",
          marginBottom: "-1px",
        }}
      >
        <p>
          Con{" "}
          <span
            style={{
              color: "#2FB423",
              fontFamily: "GothamBold",
            }}
          >
            A comer
          </span>{" "}
          puedes crear tu menú, distribuirlo y recibir pedidos
        </p>

        <p
          style={{
            fontFamily: "GothamBold",
            display: "flex",
            justifyContent: "center",
          }}
        >
          Comienza aquí, es gratis
        </p>
        <p
          style={{
            fontFamily: "GothamBook",
            display: "flex",
            justifyContent: "center",
          }}
        >
          Ingresa los datos del dueño/administrador del restaurante
        </p>
      </div>
    </div>
  );
};

export default ProfileRest;
